#include "gtest/gtest.h"
#include "factor_pool.hpp"
#include "prime_factor.hpp"
#include "big_int.hpp"
TEST(test_prime_factor, test_prime_table) {
  using namespace wigcpp::internal::global;
  using namespace wigcpp::internal::prime_calc;
  PoolManager::init(1000);
  const auto &pool = PoolManager::get();
  const auto &ref = pool.factorial_prime_factors(1000);
  pexpo_eval_temp eval;
  auto res = eval.evaluate(ref);
  EXPECT_EQ(res.to_hex_str(), "");
}